<template>
    <div class="container mt-5" style="margin-top: 1rem !important;">
        <div class="history lives-games cards">
            <table>
                <thead>
                    <tr>
                        <th>ИГРА</th>
                        <th>ЛОГИН</th>
                        <th>СТАВКА</th>
                        <th>X</th>
                        <th>ВЫИГРЫШ</th>
                    </tr>
                </thead>
                <tr v-for="(game, index) in games" :key="index">
                    <td><span class="gm" :class="game.type[0]"></span></td>
                    <td class="username">
                        {{ game.username }}
                    </td>
                    <td class="bet">{{ parseFloat(game.amount).toFixed(2) }}</td>
                    <td class="x">{{ parseFloat(game.coeff).toFixed(2) }}</td>
                    <td class="text-success">{{ parseFloat(game.result).toFixed(2) }}</td>
                </tr>
            </table>
        </div>
    </div>
</template>

<script>
export default {
    props: ['games'],
    sockets: {
        newGame(data) {
            if(this.games.length >= 14) {
                this.games.pop()
            }

            this.games.unshift(data)
        },
    }
}
</script>

<style scoped>
.bet, .text-success {
    letter-spacing: 0.4px !important;
    font-weight: 500
}
.container {
    margin-top: 2rem !important;
    padding: 0;
}
.gm.d {
    background-image: url(data:image/svg+xml;base64,);
}

.gm.m {
    background-image: url(data:image/svg+xml;base64,);
}

.gm.b {
    background-image: url(data:image/svg+xml;base64,);
}

.gm.w {
    background-image: url(data:image/png;base64,);
}

.gm.p {
    background-image: url(data:image/png;base64,);
}
.gm {
    background-size: cover;
    display: inline-block;
    height: 20px;
    width: 20px;
}
td.x {
    max-width: 170px;
    width: 170px;
}
td.username, td.x {
    overflow: hidden;
    text-align: center;
    text-overflow: ellipsis;
    white-space: nowrap;
}

td.username {
    max-width: 300px;
    width: 300px;
}
</style>